import  React, { Component } from 'react';

export default class Header extends Component {
    render() {
        return (
        <div>
            <header>
                <img src="small-logo.png" alt = 'small-logo'/>
                <h1>Delicious</h1>
                <h6>THE BEST FOOD BLOG ON THE WEB</h6>
                <img src= {this.props.image} alt = 'facebook icon'/>
                <img src= {this.props.image1} alt = 'twitter-icon'/>
                <img src={this.props.image2} alt = 'google-icon'/>
                {/* <img src="insta-icon.png" {this.props.image3}alt= 'instagram-icon'/>
                <img src="flic-icon.png"{this.props.image4}alt= 'flic-icon' />
                <img src="pint-icon.png"{this.props.image5} alt = 'pinterest-icon' />
                <img src="rss-icon.png" {this.props.image6}alt= 'rss-icon' />
                <img src="mail-icon.png"{this.props.image7} alt = 'mail-icon' /> */}
            </header>
        </div>
        );
    }
}
